import React, {
    useState,
    useEffect
} from "react";
// import '../../src/estilos/componentes/paginas/inicio.css'
import '../../src/App.css'
import {
    obtenerCartaDePresentacion
} from "./api";


const Inicio = (props) => {

        const [cartaDePresentacion, setCartaDePresentacion] = useState('');

        useEffect(() => {
            const obtenerDatos = async () => {
                const carta = await obtenerCartaDePresentacion();
                if (carta !== null) {
                    setCartaDePresentacion(carta);
                }
            };
            obtenerDatos();
        }, []);

        return ( <
            section className = "Inicio" >
            <
            h3 > Inicio < /h3> <
            div className = "seccionConBordes" >
            <
            h4 > Carta de presentacion < /h4> <
            div className = "Carta"
            id = "unaCarta" > {
                cartaDePresentacion && < p > {
                    cartaDePresentacion
                } < /p>} <
                /div> <
                /div> <
                div className = "seccionConBordes" >
                <
                h4 > Portafolios web < /h4>   <
                div className = "Portafolios contTarjetas"
                id = "unPortafolios" >
                <
                /div> <
                /div> <
                /section>
            );
        }

        export default Inicio;
